/** @format */

import { createRouter, createWebHistory } from "vue-router";
import HomeView from "../views/HomeView.vue";
import CvView from "../views/CvView.vue";
import AboutMeView from "../views/AboutMeView.vue";
import ProjectsView from "../views/ProjectsView.vue";
import CdProject from "../views/projectViews/CdProject.vue";
import BookProject from "../views/projectViews/BookProject.vue";
import PosterProject from "../views/projectViews/PosterProject.vue";
import PlantBoxProject from "../views/projectViews/PlantBoxProject.vue";
import ForsvaretProject from "../views/projectViews/ForsvaretProject.vue";
import GhostCardsProject from "../views/projectViews/GhostCardsProject.vue";
import villaParadisoProject from "../views/projectViews/villaParadisoProject.vue";
import gyldenePizzaerProject from "../views/projectViews/gyldenePizzaerProject.vue";

const routes = [
  {
    name: "HomeView",
    path: "/",
    component: HomeView,
  },
  {
    name: "CvView",
    path: "/cv",
    component: CvView,
  },
  {
    name: "AboutMeView",
    path: "/about",
    alias: ["/om", "/om-meg"],
    component: AboutMeView,
  },
  {
    name: "ProjectsView",
    path: "/projects",
    alias: "/hobby",
    component: ProjectsView,
  },
  {
    name: "CdProject",
    path: "/cdproject",
    component: CdProject,
  },
  {
    name: "BookProject",
    path: "/book",
    alias: ["/bok", "/book-project", "/bok-prosjekt"],
    component: BookProject,
  },
  {
    name: "PosterProject",
    path: "/poster",
    alias: ["/plakat", "/poster"],
    component: PosterProject,
  },
  {
    name: "PlantBoxProject",
    path: "/plantbox",
    alias: "/plantbox",
    component: PlantBoxProject,
  },

  {
    name: "GhostCards",
    path: "/ghostcards",
    alias: "/ghostcards",
    component: GhostCardsProject,
  },
  {
    name: "Forsvaret",
    path: "/forsvaret",
    alias: "/forsvaret",
    component: ForsvaretProject,
  },
  {
    name: "villaParadiso",
    path: "/villaparadiso",
    alias: "/villaparadiso",
    component: villaParadisoProject,
  },
  {
    name: "GyldenePizzaer",
    path: "/gyldenePizzaer",
    alias: "/gyldenePizzaer",
    component: gyldenePizzaerProject,
  },
];

const router = createRouter({ history: createWebHistory(), routes });

export default router;
